We Are Scientists is a New York-based rock band that formed in Berkeley, California  in the year 2000. Originally formed of Keith Murray on drums, Chris Cain playing bass guitar and Scott Lamb providing vocals and guitar, before Michael Tapper became drummer and Keith became vocalist and guitarist. The band's breakthrough success came with their second album With Love and Squalor which sold 100,000 copies in the first 6 months. Their second success was with Brain Thrust Mastery which charted at 11 in the UK album chart, with two top 40 singles &quot;After Hours&quot; and &quot;Chick Lit&quot;. They are currently promoting the release of their fourth album, Barbara, as well as starring in their own television short Steve Wants His Money.



